import React, { useState, Fragment } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { makeStyles, useTheme } from "@material-ui/core/styles";

import {
  Paper,
  withStyles,
  Grid,
  TextField,
  Button,
  FormControlLabel,
  Checkbox,
} from "@material-ui/core";

import { Link, withRouter } from "react-router-dom";
import { addLoad } from "../../actions/load";

const useStyles = makeStyles((theme) => ({
  margin: {},
  padding: {},
}));

const LoadPickup = ({ formProps:{addLoad}}) => {
  const classes = useStyles();

  return (
    <Fragment>
      <div className={classes.root}>
        <Grid
          container
          direction="row"
          justify="center"
          alignItems="center"
          spacing={1}
        >
          <Grid item md={12} xs={12}>
            //load pickup
            <TextField
              id="shipperName"
              label="ShipperName"
              name="shipperName"
              margin="normal"
              variant="outlined"
              inputRef = {addLoad}
            />
          </Grid>
          <Grid item md={12} xs={12}>
            //ช่องสำหรับกรอก password
            <TextField
              id="password"
              label="Password"
              margin="normal"
              variant="outlined"
              type="password"
            />
           </Grid>
        </Grid>
        <Grid
          container
          direction="row"
          justify="center"
          alignItems="center"
          spacing={1}
        >
          <Grid item md={12} xs={12}>
            //ช่องสำหรับกรอก confirm password
            <TextField
              id="confirm-password"
              label="Confirm Password"
              margin="normal"
              variant="outlined"
              type="password"
            />
          </Grid>
        </Grid>
      </div>
    </Fragment>
  );
};

LoadPickup.propTypes = {
  addLoad: PropTypes.func.isRequired,
};

export default connect(null, { addLoad })(withRouter(LoadPickup));
